import "./Header.css";

const Header = (props) => {
    return <div
        className="header">{"React 18 SSR example with Pipeable stream1"}
            <img src={props.logoSrc} />
            {props.loggedOut && <span id="logout" className="logout" onClick={()=>{alert('Logging out')}}>Logout</span>}
        </div>
}

export default Header;
